Individual Actor Configuration If no BufferConfig is specified Kompact will use the default settings for all BufferPools. Actors may be configured with individual BufferConfigs through the init_buffer(Some(config), None) [1] config. It is important that the call is made before any calls to tell_serialised(...). For example, the on_start() function of the ComponentLifecycle may be used to ensure this, as in the following example: impl ComponentLifecycle for CustomBufferConfigActor { fn on_start(&mut self) -> Handled { let mut buffer_config = BufferConfig::default(); buffer_config.encode_buf_min_free_space(128); buffer_config.max_chunk_count(5); buffer_config.initial_chunk_count(4); buffer_config.chunk_size(256*1024); self.ctx.borrow().init_buffers(Some(buffer_config), None); Handled::Ok } ...
} Configuring All Actors If a programmer wishes for all actors to use the same BufferConfig configuration, a Hocon string can be inserted into the KompactConfig or loaded from a Hocon-file ( see configuration chapter on loading configurations ), for example: let mut cfg = KompactConfig::new();
cfg.load_config_str( r#"{ buffer_config { chunk_size: "256KB", initial_chunk_count: 3, max_chunk_count: 4, encode_min_remaining: "20B", } }"#,
);
...
let system = cfg.build().expect("KompactSystem"); If a BufferConfig is loaded into the systems KompactConfig then all actors will use that configuration instead of the default BufferConfig, however individual actors may still override the configuration by using the init_buffers(...) method. Configuring the NetworkDispatcher and NetworkThread The NetworkDispatcher and NetworkThread are configured separately from the Actors and use their buffers for lazy serialisation and receiving data from the network. To configure their buffers the NetworkConfig may be created using the method ::with_buffer_config(...) as in the example below: let mut cfg = KompactConfig::new();
let mut network_buffer_config = BufferConfig::default();
network_buffer_config.chunk_size(512);
network_buffer_config.initial_chunk_count(2);
network_buffer_config.max_chunk_count(3);
network_buffer_config.encode_buf_min_free_space(10);
cfg.system_components(DeadletterBox::new, { NetworkConfig::with_buffer_config( "127.0.0.1:0".parse().expect("Address should work"), network_buffer_config, ) .build()
});
let system = cfg.build().expect("KompactSystem"); BufferConfig Validation BufferConfig implements the method validate() which causes a panic if the set of parameters is invalid. It is invoked whenever a BufferPool is created from the given configuration. The validation checks that the following conditions hold true: chunk_size > encode_buf_min_free_space chunk_size > 127 max_chunk_count >= initial_chunk_count The method init_buffers(...) takes two Option arguments, of which the second argument has not been covered. The second argument allows users of Kompact to specify a CustomAllocator: a poorly tested, experimental feature which is left undocumented for the time being.

