To subscribe to the import a component must implement Require for NetworkStatusPort. The system must be set-up with a NetworkingConfig to enable Networking. When the component is instantiated it must be explicitly connected to the NetworkStatusPort. KompactSystem exposes the convenience method connect_network_status_port<C>(&self, required: &mut RequiredPort<NetworkStatusPort>) to subscribe a component to the port, and may be used as in the example below. # use kompact::prelude::*;
# use kompact::net::net_test_helpers::NetworkStatusCounter;
let mut cfg = KompactConfig::new();
cfg.system_components(DeadletterBox::new, { let net_config = NetworkConfig::new("127.0.0.1:0".parse().expect("")); net_config.build()
});
let system = cfg.build().expect("KompactSystem");
let status_counter = system.create(NetworkStatusCounter::new);
status_counter.on_definition(|c|{ system.connect_network_status_port(&mut c.network_status_port);
})

