When we create a resolver instance via async_std_resolver::resolver, we actually get a future back that we need to wait for. But our DNS component can't perform any lookups until this future completed. Normally, we would have to manually queue up all requests received during that period until the future completed and then replay them. Instead, we can "block" on the provided future, causing the component itself to enter into a blocked lifecycle state, during which it handles no messages or events. Only when the future's result is available will the component enter the active state and process other events and messages as normal again. In order to enter the blocked state, we must return a a special variant of the Handled enum, which is obtained from the Handled::block_on(...) method. This method takes the self reference to the component and an asynchronous closure, that is a closure that produces a future when invoked. This closure is given a single parameter by the Kompact API, which is an access guard object to a mutable component reference. In order words, a special owned struct that can be mutably dereferenced to the current component definition type. This guard object ensures safe mutable access to the current component instance, whenever the resulting future is polled, but prevents holding on to actual references over await calls (which are illegal). It is very important that this guard object is never sent to another thread from within the future. The async closure can not directly close over the component's self reference, as the correct lifetime for it can not be guaranteed. Only the references obtained from the special guard object are safe in between await calls. Having said all that, in our case the async closure very simply awaits the result of the resolver creation and then stores it locally, after which the component unblocks. # #![allow(clippy::unused_unit)]
