# impl Actor for DnsComponent { type Message = Ask<DnsRequest, DnsResponse>; fn receive_local(&mut self, msg: Self::Message) -> Handled { debug!(self.log(), "Got request for domain: {}", msg.request().0); if let Some(ref resolver) = self.resolver { let query_result_future = resolver.lookup( msg.request().0.clone(), RecordType::A, DnsRequestOptions::default(), ); self.spawn_local(move |async_self| async move { let query_result = query_result_future.await.expect("dns query result"); debug!( async_self.log(), "Got reply for domain: {}", msg.request().0 ); let mut results: Vec<String> = Vec::new(); for (index, ip) in query_result.iter().enumerate() { results.push(format!("{}. {:?}", index, ip)); } let result_string = format!("{}:\n {}", msg.request().0, results.join("\n ")); msg.reply(DnsResponse(result_string)).expect("reply"); Handled::Ok }); Handled::Ok } else { panic!("Component should have been initialised first!") } } fn receive_network(&mut self, _msg: NetMessage) -> Handled { unimplemented!("ignore networking"); }
