struct HelloWorldComponent { ctx: ComponentContext<Self>,
}
# impl HelloWorldComponent {
# pub fn new() -> Self {
# HelloWorldComponent {
# ctx: ComponentContext::uninitialised(),
# }
# }
# }
# impl ComponentLifecycle for HelloWorldComponent {
