Since the worker is stateless, its implementation is really simple. It's basically just a francy wrapper around a slice fold. That is, whenever we get a WorkPart message on our receive_local(...) function from the Actor trait, we simply take a slice of the range we were allocated to work on, and then call fold(msg.neutral, msg.merger) on it to produce the desired u64 result. And then we simply wrap the result into a WorkResult, which we trigger on our instance of WorkerPort so it gets back to the manager. # #![allow(clippy::unused_unit)]
