The Message type for the manager is thus Ask<Work, WorkResponse>, which we already saw when describing its state . In order to access the actual Work instance in our receive_local(...) implementation, we use the Ask::request() function. We then must distribute the work more or less evenly over the available workers. If no workers are available, the manager simply does all the work itself. Otherwise we'll figure out what constitutes and "equal share" (i.e. the stride) and then use it to step through the indices into the data, producing sub-ranges, which we send to each worker immediately. Since it may sometimes happen due to rounding that we have a tiny bit of work left at the end, we just do that at the manager and put it directly into the self.result_accumulator. This extra work, it the reason for the previously mentioned + 1 whenever we are considering the length of the self.result_accumulator. It is simply the manager's share of the work. In order to keep this length consistent, we will simply push the work.neutral element whenever the manager actually doesn't do any work. Finally, we need to remember to store the request in self.outstanding_request so we can reply to it later when all responses have arrived. # #![allow(clippy::unused_unit)]
