For our worker pool example, we will simply use the default configuration, and start a Manager component with a configurable number of workers. We then create some data array of a configurable size and send a work request with it and an aggregation function to the manager instance. We'll use simple addition with overflow as our aggregation function, which means our neutral element is 0u64. The data array we'll generate is simply the integers from 1 to data_size, which means our aggregate will actually calculate a triangular number (modulo overflows, for which we probably don't have enough memory for the data array anyway). Since that particular number has a much simpler solution, i.e. \( \sum_{k=1}^n k = \frac{n\cdot(n+1)}{2} \), we will also use an assertion to verify we are actually producing the right result (again, this probably won't work if we actually do overflow during aggregration, but oh well...details ;). # #![allow(clippy::unused_unit)]
