To illustrate this mechanism we are going to rewrite the Workers example from the previous sections to use WithSender instead of the WorkerPort communication. We will use WithSender here, instead of a stored manager actor reference, to illustrate the point, but it should be clear that the latter will be more efficient as we always reply to the manager. First we remove all mentions of WorkerPort, of course. Then we change the worker's Message type to WithSender<WorkPart, ManagerMessage>. Why ManagerMessage and not WorkResult? Well, since all communication with the manager now happens via messages, we need to differentiate between messages from the main-thread, which are of type Ask<Work, WorkResult> and messages from the worker, which are of type WorkResult. Since we can only have a single Message type, ManagerMessage is simply an enum of both options. # #![allow(clippy::unused_unit)]
