Both implementations share the basic events and ports involved. They also both use a printer component for Batch events, which simply logs the size of each batch so we can see it during execution. use kompact::prelude::*; #[derive(Clone, Debug)]
pub struct Ping(pub u64); #[derive(Clone, Debug)]
pub struct Batch(pub Vec<Ping>); pub struct Batching;
impl Port for Batching { type Indication = Batch; type Request = Ping;
} #[derive(ComponentDefinition, Actor)]
pub struct BatchPrinter { ctx: ComponentContext<Self>, batch_port: RequiredPort<Batching>,
}
impl BatchPrinter { pub fn new() -> Self { BatchPrinter { ctx: ComponentContext::uninitialised(), batch_port: RequiredPort::uninitialised(), } }
} ignore_lifecycle!(BatchPrinter); impl Require<Batching> for BatchPrinter { fn handle(&mut self, batch: Batch) -> Handled { info!(self.log(), "Got a batch with {} Pings.", batch.0.len()); Handled::Ok }
} They'll also really use the same running code, even though its repeated in each file so it picks the correct implementation. In either case, we set up the Buncher and the BatchPrinter in a default system, connect them via biconnect_components(...) and then send them two waves of Ping events. The first wave comes around every millisecond, depending on concrete thread scheduling by the OS, while the second comes around every second millisecond. With a batch size of 100 and a timeout of 150ms we will see mostly full batches in the first wave, while we usually see time-triggered waves in the second wave. # #![allow(clippy::unused_unit)]
