With the above, you are set to run the simplest of Kompact projects, the venerable "Hello World". Create a new executable file, such as main.rs, and write a very simple component that just logs "Hello World" at the info level when it's started and ignores all other messages and events: # #![allow(clippy::unused_unit)]
use kompact::prelude::*; #[derive(ComponentDefinition, Actor)]
struct HelloWorldComponent { ctx: ComponentContext<Self>,
}
impl HelloWorldComponent { pub fn new() -> Self { HelloWorldComponent { ctx: ComponentContext::uninitialised(), } }
}
impl ComponentLifecycle for HelloWorldComponent { fn on_start(&mut self) -> Handled { info!(self.log(), "Hello World!"); self.ctx.system().shutdown_async(); Handled::Ok }
}
