# use super::*;
# # #[test]
# fn test_helloworld() {
# main();
# }
# } The await_termination() call blocks the main-thread while the Kompact system is operating on its own thread pool. We will get into more details on scheduling and thread pools a bit later in this tutorial. For now it is sufficient to know, that once the Kompact system has been shut down by our HelloWorldComponent using shutdown_async(), the main-thread will eventually continue. We can run this code, depending on how you set up your project, with: cargo run --release This will give us something like the following output: lkroll $ cargo run --release --bin helloworld Finished release [optimized] target(s) in 0.09s Running `/Users/lkroll/Programming/Kompics/kompact/target/release/helloworld`
Jul 07 16:28:45.870 INFO Hello World!, ctype: HelloWorldComponent, cid: 804ed483-54d5-41ab-ad8f-145f90bc7b45, system: kompact-runtime-1, location: docs/examples/src/bin/helloworld.rs:17 We can see the "Hello World" being logged, alongside a bunch of other contextual information that is automatically inserted by the runtime, such as the type name of the component doing the logging (ctype), the unique id of the component (cid) which differentiates from other instances of the same type, the name of the Kompact system, as well as the concrete location in the file where the logging statement occurs. If we run in debug mode, instead of release, using the simple cargo run we get a lot of additional output at the debug level, concerning system and component lifecycle – more on that later. Note: If you have checked out the examples folder and are trying to run from there, you need to specify the concrete binary with: cargo run --release --bin helloworld

