Kompact uses the slog crate to provide system wide logging facilities. The basic macros for this, slog::{crit, debug, error, info, o, trace, warn} are re-exported in the prelude for convenience. Logging works out of the box with a default asynchronous console logger implementation that roughly corresponds to the following setup code: let decorator = slog_term::TermDecorator::new().stdout().build();
let drain = slog_term::FullFormat::new(decorator).build().fuse();
let drain = slog_async::Async::new(drain).chan_size(1024).build().fuse();
let logger = slog::Logger::root_typed(Arc::new(drain)); The actual logging levels are controlled via build features. The default features correspond to max_level_trace and release_max_level_info, that is in debug builds all levels are shown, while in the release profile only info and more severe message are shown. Alternatively, Kompact provides a slightly less verbose feature variant called silent_logging, which is equivalent to max_level_info and release_max_level_error. This is exemplified in the following very simple code example: # #![allow(clippy::unused_unit)]
# use kompact::prelude::*;
# use std::time::Duration;
# pub fn main() { let system = KompactConfig::default().build().expect("system"); trace!( system.logger(), "You will only see this in debug builds with default features" ); debug!( system.logger(), "You will only see this in debug builds with default features" ); info!(system.logger(), "You will only see this in debug builds with silent_logging or in release builds with default features"); warn!(system.logger(), "You will only see this in debug builds with silent_logging or in release builds with default features"); error!(system.logger(), "You will always see this"); // remember that logging is asynchronous and won't happen if the system is shut down already std::thread::sleep(Duration::from_millis(100)); system.shutdown().expect("shutdown");
}
# # #[cfg(test)]
# mod tests {
# use super::*;
# # #[test]
# fn test_logging() {
# main();
# }
# } Try to run it with a few different build settings and see what you get. Note: As before, if you have checked out the examples folder you can run the concrete binary with: cargo run --release --bin logging

