Kompact is a very strictly and statically typed framework. Sometimes, however, it is beneficial to be a little more dynamic. There are many reasons you might want to introduce some dynamism into your component system: modularity, ease of modeling, or sometimes even performance: static dispatch in Rust often involves monomorphising substantial amounts of generic code, which leads to code bloat. The more instructions the CPU has to load the more likely it is that something won't fit in the cache, which can incur performance penalties. Because of this, we introduced a way to deal with components with a little bit of dynamic typing. Namely, you're able to create components from type-erased definitions with {System,SystemHandle}::create_erased (nightly only), and query type-erased components for ports they may provide and/or require with on_dyn_definition and get_{provided,required}_port. Note: While creating type-erased components from type-erased definitions is nightly-only, you can create component just normally and then cast it to a type-erased component on stable. Let's create a dynamic interactive system showcasing these features. We'll build a little REPL which the user can use to spawn some components, set their settings, and send them some data to process. First some basic components: # #![allow(clippy::unused_unit)]
# # use kompact::{component::AbstractComponent, prelude::*};
# use std::{
# error::Error,
# fmt,
# io::{stdin, BufRead},
# sync::Arc,
# };
# #[derive(ComponentDefinition)]
struct Adder { ctx: ComponentContext<Self>, offset: f32, set_offset: ProvidedPort<SetOffset>,
}
info_lifecycle!(Adder); impl Actor for Adder { type Message = f32; fn receive_local(&mut self, a: Self::Message) -> Handled { let res = a + self.offset; info!(self.log(), "Adder result = {}", res); Handled::Ok } fn receive_network(&mut self, _msg: NetMessage) -> Handled { unimplemented!() }
} struct SetOffset; impl Port for SetOffset { type Indication = Never; type Request = f32;
} impl Provide<SetOffset> for Adder { fn handle(&mut self, value: f32) -> Handled { self.offset = value; Handled::Ok }
} impl Adder { pub fn new() -> Self { Adder { ctx: ComponentContext::uninitialised(), offset: 0f32, set_offset: ProvidedPort::uninitialised(), } }
} #[derive(ComponentDefinition)]
struct Multiplier { ctx: ComponentContext<Self>, scale: f32, set_scale: ProvidedPort<SetScale>,
}
info_lifecycle!(Multiplier); impl Actor for Multiplier { type Message = f32; fn receive_local(&mut self, a: Self::Message) -> Handled { let res = a * self.scale; info!(self.log(), "Multiplier result = {}", res); Handled::Ok } fn receive_network(&mut self, _msg: NetMessage) -> Handled { unimplemented!() }
} struct SetScale; impl Port for SetScale { type Indication = Never; type Request = f32;
} impl Provide<SetScale> for Multiplier { fn handle(&mut self, value: f32) -> Handled { self.scale = value; Handled::Ok }
} impl Multiplier { fn new() -> Multiplier { Multiplier { ctx: ComponentContext::uninitialised(), scale: 1.0, set_scale: ProvidedPort::uninitialised(), } }
}
