There is a bit of state we need to keep track of in our EventualLeaderElector component: First me must provide the EventualLeaderDetection port, of course. We also need to track the current process set, which we will handle as a boxed slice shared behind an Arc, since all components should have the same set anyway. Of course, if we were running this in real distribution, and not just with multiple systems in a single process, we would probably only run a single instance per process and a simple boxed slice (or just a normal vector) would probably be more sensible. Further we must track the current candidate set, for which we will use a standard HashSet to avoid adding duplicates. We also need to know how often to check the candidate set and update our leader. Since this time needs to be able to dynamically adjust to network conditions, we keep two values for this in our state: The current period and a delta value, which we use when we need to adjust the period. The delta is technically immutable and could be a constant, but we want to make both values configurable , so we need to store the loaded values somewhere. Finally, we to keep track of the current timer handle and the current leader, if any. # #![allow(clippy::unused_unit)]
