This part isn't very specific to networking, but basically the election algorithm works as follows: Every time the timeout fires we clear out the current candidate set into a temporary vector. We then sort the vector and take the last element, if any, as the potential new leader. If that new leader is not the same as the current one then either our current leader has failed, or the timeout is wrong. For simplicity we will assume both is true and replace the leader and update the scheduled timeout by adding the delta to the current period. We then announce our new leader choice via a trigger on the EventualLeaderDetection port. Whether or not we replaced the leader, we always send heartbeats to everyone in the process set. # #![allow(clippy::unused_unit)]
