In the Kompics component model, the term for a light-weight process with internal state is a "component". This notion can be further subdivided into the process-part of a component, a component core , and the state-part of a component, which is called a component definition . The core basically just interacts with the runtime of the system, while the definition contains the state variables and behaviours, in the form of ports and event handlers , which we will discuss below. The execution model of a component model always ensures that the state variables of a component definition can be accessed safely without any synchronisation. In the Kompact implementation, a component definition is simply a Rust struct that contains a ComponentContext as a field and implements the ComponentDefinition trait, which is typically just derived automatically, as we saw in the "Hello World"-example: # #![allow(clippy::unused_unit)]
# use kompact::prelude::*;
# #[derive(ComponentDefinition, Actor)]
struct HelloWorldComponent { ctx: ComponentContext<Self>,
}
# impl HelloWorldComponent {
# pub fn new() -> Self {
# HelloWorldComponent {
# ctx: ComponentContext::uninitialised(),
# }
# }
# }
# impl ComponentLifecycle for HelloWorldComponent {
# fn on_start(&mut self) -> Handled {
# info!(self.log(), "Hello World!");
# self.ctx.system().shutdown_async();
# Handled::Ok
# }
# }
# # pub fn main() {
# let system = KompactConfig::default().build().expect("system");
# let component = system.create(HelloWorldComponent::new);
# system.start(&component);
# system.await_termination();
# }
# # #[cfg(test)]
# mod tests {
# use super::*;
# # #[test]
# fn test_helloworld() {
# main();
# }
# } The component core itself is hidden from us in Kompact, but we can interact with it using the ComponentContext field from within a component. When we actually instantiate a component as part of a Kompact system, we are given an Arc<Component>, which is a combined reference to the component definition and core. The creation of this structure is what really happened when we invoked system.create(...) in the "Hello World"-example: # #![allow(clippy::unused_unit)]
