The behaviour of the bootstrap server is very simple. Whenever it gets a CheckIn, it adds the source of the message to its process set and then broadcasts the new process set to every process in the set. We will use the NetworkActor trait to implement the actor part here instead of Actor. NetworkActor is a convenience trait for actors that handle the same set of messages locally and remotely and ignore all other remote messages. It handles the deserialisation part for us, but we must tell it both the Message type and the Deserialiser type to use. Of course, in this case we don't actually do anything for local messages, since we only need the sender and local messages simply don't have a sender attached. # #![allow(clippy::unused_unit)]
