The one thing that sets our bootstrap server creation apart from any other actor we have created so far, is that we want a named actor path for it. Basically, we want any other process to be able to constuct a valid ActorPath instance for the bootstrap server, such as tcp://127.0.0.1:<port>/bootstrap , given only the port for it. In order to make Kompact resolve that path to the correct component we must do two things: Make sure that the Kompact system actually runs on localhost at the given port, and register a named path alias for the BootstrapServer with the name "bootstrap". To achieve the first part, we create the NetworkDispatcher from a SocketAddr instance that contains the correct IP and port instead of using the default value as we did before. To register a component with a named path, we must call KompactSystem::register_by_alias(...) with the target component and the path to register. The rest is more or less as before. # #![allow(clippy::unused_unit)]
