Components communicate via events that are propagated along channels to a set of target components. The Kompics model is very strict about which events may travel on which channels, which it formalises with the concept of a port . Ports basically just state which events may travel in which way through the channels connected to it. You can think of a port as an API specification. If a component C provides the API of a port P , then it will accept all events of types that are marked as request in P , and it will only send events of the types that are marked as indication in P . Since components communicate with each other, the dual notion to providing a port is requiring it, and channels may only connect opposite variants of ports. That is, if one end of a channel is connected to a provided port of type P then the other side must be connected to a required port of type P . This setup ensures that messages which are sent through the channel are also accepted on the other side. In Kompact each port is limited to a single indication and a single request type. If more types are needed in either direction, they must be wrapped into an enum, which is facilitated easily in Rust using the From and Into traits. For example, a simplified version of Kompact's internal ControlPort, which could be defined something like this: #[derive(Clone, Debug, PartialEq, Eq)]
pub enum ControlEvent { Start, Stop, Kill,
} pub struct ControlPort; impl Port for ControlPort { type Indication = Never; // alias for the ! bottom type type Request = ControlEvent;
} It has a single request event of type ControlEvent, which provides three different variants, invoked at particular points in a component's lifecycle. It does not send any indication events, however, which is marked by the Never type, which is uninhabited. In order to react to the events of a port we must implement an trait appropriate trait for the direction of the events. For the control port above, for example, we might want to implement Provide<ControlPort> to react to ControlEvent instances. This could look as follows, for example: impl Provide<ControlPort> for HelloWorldComponent { fn handle(&mut self, event: ControlEvent) -> Handled { match event { ControlEvent::Start => { info!(self.log(), "Hello World!"); self.ctx.system().shutdown_async(); Handled::Ok } ControlEvent::Stop | ControlEvent::Kill => Handled::Ok, } }
} This mechanism is similar to the concept of event handlers in the Kompics model, except that you can only have a single handler in Kompact and it is always (statically) subscribed . In this way the compiler can statically ensure that any component providing (or requiring) a port also accepts the appropriate events. In Kompact, however, the ControlPort is not exposed (anymore since version 0.10.0), but instead we must implement the ComponentLifecycle trait to react to (some of) its events, as we did in the HelloWorldComponent example: # #![allow(clippy::unused_unit)]
# use kompact::prelude::*;
# # #[derive(ComponentDefinition, Actor)]
# struct HelloWorldComponent {
# ctx: ComponentContext<Self>,
# }
# impl HelloWorldComponent {
# pub fn new() -> Self {
# HelloWorldComponent {
# ctx: ComponentContext::uninitialised(),
# }
# }
# }
impl ComponentLifecycle for HelloWorldComponent { fn on_start(&mut self) -> Handled { info!(self.log(), "Hello World!"); self.ctx.system().shutdown_async(); Handled::Ok }
}
# # pub fn main() {
# let system = KompactConfig::default().build().expect("system");
# let component = system.create(HelloWorldComponent::new);
# system.start(&component);
# system.await_termination();
# }
# # #[cfg(test)]
# mod tests {
# use super::*;
# # #[test]
# fn test_helloworld() {
# main();
# }
# }

