At the centre of Kompact's serialisation mechanisms are the Serialisable and Deserialiser traits, the signature of which looks roughtly like this: pub trait Serialisable: Send + Debug { /// The serialisation id for this serialisable fn ser_id(&self) -> SerId; /// An indicator how many bytes must be reserved in a buffer for a value to be /// serialsed into it with this serialiser fn size_hint(&self) -> Option<usize>; /// Serialises this object (`self`) into `buf` fn serialise(&self, buf: &mut dyn BufMut) -> Result<(), SerError>; /// Try move this object onto the heap for reflection, instead of serialising fn local(self: Box<Self>) -> Result<Box<dyn Any + Send>, Box<dyn Serialisable>>;
} pub trait Deserialiser<T>: Send { /// The serialisation id for which this deserialiser is to be invoked const SER_ID: SerId; /// Try to deserialise a `T` from the given `buf` fn deserialise(buf: &mut dyn Buf) -> Result<T, SerError>;
}

