When ActorPath::tell(...) is invoked with a type that is Serialisable, it will create a boxed trait object from the given instance and send it to the network layer. Only when the network layer has the determind that the destination must be accessed via a network channel, will the runtime serialise the instance into the network channel's buffer. If it turns out the destination is on the same actor system as the source, it will simply call Serialisable::local(...) to get a boxed instance of the Any trait and then send it directly to the target component, without ever serialising. This approach is called lazy serialisation . For the vast majority of Serialisable implementations, Serialisable::local(...) is implemented simply as Ok(self). However, for some more advanced usages (e.g., serialisation proxies) the implementation may have to call some additional code. Once it is determined that an instance does indeed need to be serialised, the runtime will reserve some buffer memory for it to be serialised into. It does so by querying the Serialisable::size_hint(...) function for an estimate of how much space the type is likely going to take. For some types this is easy to know statically, but others it is not so clear. In any case, this is just an optimisation. Serialisation will proceed correctly even if the estimate is terribly wrong or no estimate is given at all. The first thing in the new serialisation buffer is typically the serialisation id obtained via Serialisable::ser_id(...). Typically, Kompact will only require a single serialisation id for the message to be written into the buffer, even if the message uses other serialisers internally, as long as all the internal types are statically known. This top-level serialisation id must match the Deserialiser::SER_ID for the deserialiser to be used for this instance. For types that implement both Serialisable and Deserialiser, as most do, it is recommended to simply use is Self::SER_ID as the implementation for Serialisable::ser_id(...) to make sure the ids match later. The actual serialisation of the instance is handled by Serialisable::serialise(...), which should use the functions provided by BufMut to serialise the individual parts of the instance into the buffer. Serialiser Instead of implementing Serialisable we can also implement the Serialiser trait: pub trait Serialiser<T>: Send { /// The serialisation id for this serialiser fn ser_id(&self) -> SerId; /// An indicator how many bytes must be reserved in a buffer for a value to be fn size_hint(&self) -> Option<usize>; /// Serialise `v` into `buf`. fn serialise(&self, v: &T, buf: &mut dyn BufMut) -> Result<(), SerError>;
} This behaves essentually the same, except that it doesn't serialise itself, but an instance of another type T. In order to use an instance t: T with a Serialiser<T> we can simply pass a pair of the two to the ActorPath::tell(...) function, as we have already seen in the previous section, for example with Serde: # #![allow(clippy::unused_unit)]
