To show how custom serialisers can be implemented, we will show two examples re-using the bootstrapping leader election from the previous sections. Serialiser In our example, CheckIn is a zero-sized type (ZST), since we don't really care about the message, only about the sender. Since ZSTs have no content, we can uniquely identify them by their serialisation id alone and all the serialisers for them are basically identical, in that their serialise(...) function consists simply of Ok(()). For this example, instead of using Serde for CheckIn, we will write our own Serialiser implementation for ZSTs and then use it for CheckIn. We could also use it for Heartbeat, but we won't, so as to leave it as a reference for the other approach. # #![allow(clippy::unused_unit)]
