# struct ZstSerialiser<T>(T)
where T: Send + Sync + Default + Copy + SerialisationId; impl<T> Serialiser<T> for &ZstSerialiser<T>
where T: Send + Sync + Default + Copy + SerialisationId,
{ fn ser_id(&self) -> SerId { T::SER_ID } fn size_hint(&self) -> Option<usize> { Some(0) } fn serialise(&self, _v: &T, _buf: &mut dyn BufMut) -> Result<(), SerError> { Ok(()) }
} impl<T> Deserialiser<T> for ZstSerialiser<T>
where T: Send + Sync + Default + Copy + SerialisationId,
{ const SER_ID: SerId = T::SER_ID; fn deserialise(_buf: &mut dyn Buf) -> Result<T, SerError> { Ok(T::default()) }
} #[derive(Debug, Clone, Copy, Default)]
struct CheckIn; impl SerialisationId for CheckIn { const SER_ID: SerId = 2345;
} static CHECK_IN_SER: ZstSerialiser<CheckIn> = ZstSerialiser(CheckIn);
